SELECT MIN("lineorder"."lo_suppkey" + "lineorder"."lo_revenue") as agg_0, MIN("lineorder"."lo_custkey" + "lineorder"."lo_commitdate") as agg_1 FROM "lineorder" LEFT OUTER JOIN "dim_date" ON "lineorder"."lo_orderdate" = "dim_date"."d_datekey" LEFT OUTER JOIN "customer" ON "lineorder"."lo_custkey" = "customer"."c_custkey" LEFT OUTER JOIN "part" ON "lineorder"."lo_partkey" = "part"."p_partkey" LEFT OUTER JOIN "supplier" ON "lineorder"."lo_suppkey" = "supplier"."s_suppkey"  WHERE "supplier"."s_region" != 'MIDDLE EAST' AND ("customer"."c_city" IN ('IRAQ     6', 'MOROCCO  8') OR "customer"."c_region" != 'AMERICA' OR "customer"."c_city" = 'IRAQ     1') AND ("lineorder"."lo_commitdate" >= 19975369 OR "lineorder"."lo_commitdate" >= 19960890) AND "dim_date"."d_datekey" <= 19960317 AND "lineorder"."lo_orderpriority" = '5-LOW'